\[
I = 
\begin{aligned}
\begin{cases}
0 \ &\text{if} \ V_{GS} < V_T \ (\text{Cutoff}) \\
K\cdot ((V_{GS} - V_T)\cdot V_{DS} - \frac{1}{2}V_{DS}^2) \ &\text{if} \ V_{DS} < V_{GS} - V_T \ (\text{Triode}) \\
\frac{1}{2}K(V_{GS} - V_T)^2(1 + \lambda V_{DS}) \ &\text{if} \ V_{DS} \geq V_{GS} - V_T \ (\text{Saturation}) \\
\end{cases}
\end{aligned}
\]
